  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lacreek Migratory
  Waterfowl Refuge outlines Refuge accomplishments from August through October of
  1938. The report begins by summarizing the water conditions and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, predators,
  and rodents- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and collections and receipts. Resource management
  is outlined; topics include haying and fur harvesting. Photographs are attached.\",\n\t\"license_title\":
